selector_to_html = {"a[href=\"#punycode-decode-string\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.decode(string)</span></code><a class=\"headerlink\" href=\"#punycode-decode-string\" title=\"Link to this heading\">#</a></h3><p>Converts a Punycode string of ASCII symbols to a string of Unicode symbols.</p>", "a[href=\"#punycode-tounicode-input\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.toUnicode(input)</span></code><a class=\"headerlink\" href=\"#punycode-tounicode-input\" title=\"Link to this heading\">#</a></h3><p>Converts a Punycode string representing a domain name or an email address to Unicode. Only the Punycoded parts of the input will be converted, i.e. it doesn\u2019t matter if you call it on a string that has already been converted to Unicode.</p>", "a[href=\"#author\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Author<a class=\"headerlink\" href=\"#author\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#api\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">API<a class=\"headerlink\" href=\"#api\" title=\"Link to this heading\">#</a></h2><h3><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.decode(string)</span></code><a class=\"headerlink\" href=\"#punycode-decode-string\" title=\"Link to this heading\">#</a></h3><p>Converts a Punycode string of ASCII symbols to a string of Unicode symbols.</p>", "a[href=\"#punycode-ucs2-encode-codepoints\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.ucs2.encode(codePoints)</span></code><a class=\"headerlink\" href=\"#punycode-ucs2-encode-codepoints\" title=\"Link to this heading\">#</a></h4><p>Creates a string based on an array of numeric code point values.</p>", "a[href=\"#punycode-ucs2-decode-string\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.ucs2.decode(string)</span></code><a class=\"headerlink\" href=\"#punycode-ucs2-decode-string\" title=\"Link to this heading\">#</a></h4><p>Creates an array containing the numeric code point values of each Unicode symbol in the string. While <a class=\"tippyAnchor reference external\" href=\"https://mathiasbynens.be/notes/javascript-encoding\">JavaScript uses UCS-2 internally</a>, this function will convert a pair of surrogate halves (each of which UCS-2 exposes as separate characters) into a single code point, matching UTF-16.</p>", "a[href=\"#punycode-js\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Punycode.js <a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/package/punycode\"><img alt=\"punycode on npm\" loading=\"lazy\" src=\"https://img.shields.io/npm/v/punycode\"/></a> <a class=\"tippyAnchor reference external\" href=\"https://www.jsdelivr.com/package/npm/punycode\"><img alt=\"\" loading=\"lazy\" src=\"https://data.jsdelivr.com/v1/package/npm/punycode/badge\"/></a><a class=\"headerlink\" href=\"#punycode-js\" title=\"Link to this heading\">#</a></h1><p>Punycode.js is a robust Punycode converter that fully complies to <a class=\"tippyAnchor reference external\" href=\"https://tools.ietf.org/html/rfc3492\">RFC 3492</a> and <a class=\"tippyAnchor reference external\" href=\"https://tools.ietf.org/html/rfc5891\">RFC 5891</a>.</p><p>This JavaScript library is the result of comparing, optimizing and documenting different open-source implementations of the Punycode algorithm:</p>", "a[href=\"#installation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installation<a class=\"headerlink\" href=\"#installation\" title=\"Link to this heading\">#</a></h2><p>Via <a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/\">npm</a>:</p>", "a[href=\"#punycode-toascii-input\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.toASCII(input)</span></code><a class=\"headerlink\" href=\"#punycode-toascii-input\" title=\"Link to this heading\">#</a></h3><p>Converts a lowercased Unicode string representing a domain name or an email address to Punycode. Only the non-ASCII parts of the input will be converted, i.e. it doesn\u2019t matter if you call it with a domain that\u2019s already in ASCII.</p>", "a[href=\"#punycode-encode-string\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.encode(string)</span></code><a class=\"headerlink\" href=\"#punycode-encode-string\" title=\"Link to this heading\">#</a></h3><p>Converts a string of Unicode symbols to a Punycode string of ASCII symbols.</p>", "a[href=\"#for-maintainers\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">For maintainers<a class=\"headerlink\" href=\"#for-maintainers\" title=\"Link to this heading\">#</a></h2><h3>How to publish a new release<a class=\"headerlink\" href=\"#how-to-publish-a-new-release\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#punycode-ucs2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.ucs2</span></code><a class=\"headerlink\" href=\"#punycode-ucs2\" title=\"Link to this heading\">#</a></h3><h4><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.ucs2.decode(string)</span></code><a class=\"headerlink\" href=\"#punycode-ucs2-decode-string\" title=\"Link to this heading\">#</a></h4><p>Creates an array containing the numeric code point values of each Unicode symbol in the string. While <a class=\"tippyAnchor reference external\" href=\"https://mathiasbynens.be/notes/javascript-encoding\">JavaScript uses UCS-2 internally</a>, this function will convert a pair of surrogate halves (each of which UCS-2 exposes as separate characters) into a single code point, matching UTF-16.</p>", "a[href=\"#punycode-version\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><code class=\"docutils literal notranslate\"><span class=\"pre\">punycode.version</span></code><a class=\"headerlink\" href=\"#punycode-version\" title=\"Link to this heading\">#</a></h3><p>A string representing the current Punycode.js version number.</p>", "a[href=\"#license\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">License<a class=\"headerlink\" href=\"#license\" title=\"Link to this heading\">#</a></h2><p>Punycode.js is available under the <a class=\"tippyAnchor reference external\" href=\"https://mths.be/mit\">MIT</a> license.</p>", "a[href=\"#how-to-publish-a-new-release\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">How to publish a new release<a class=\"headerlink\" href=\"#how-to-publish-a-new-release\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
